import{_ as s,o as n,c as o,a1 as e}from"./chunks/framework.Dl-aaRiw.js";const r="/anduril-docs/assets/image-4.BfJMYkW-.png",t="/anduril-docs/assets/image-6.CsdrtY0Y.png",h=JSON.parse('{"title":"Como Importar um Retorno CNAB","description":"","frontmatter":{},"headers":[],"relativePath":"cnab/como-importar-retorno.md","filePath":"cnab/como-importar-retorno.md"}'),p={name:"cnab/como-importar-retorno.md"};function i(l,a,c,d,u,m){return n(),o("div",null,[...a[0]||(a[0]=[e('<h1 id="como-importar-um-retorno-cnab" tabindex="-1">Como Importar um Retorno CNAB <a class="header-anchor" href="#como-importar-um-retorno-cnab" aria-label="Permalink to &quot;Como Importar um Retorno CNAB&quot;">​</a></h1><h2 id="objetivo" tabindex="-1">Objetivo <a class="header-anchor" href="#objetivo" aria-label="Permalink to &quot;Objetivo&quot;">​</a></h2><p>Aprender como processar um retorno CNAB do banco para atualizar status de pagamentos.</p><h2 id="pre-requisitos" tabindex="-1">Pré-requisitos <a class="header-anchor" href="#pre-requisitos" aria-label="Permalink to &quot;Pré-requisitos&quot;">​</a></h2><ul><li>Remessa CNAB já foi enviada ao banco</li><li>Banco processou e retornou arquivo</li><li>Arquivo de retorno disponível (extensão .REM ou .txt)</li></ul><h2 id="localizacao" tabindex="-1">Localização <a class="header-anchor" href="#localizacao" aria-label="Permalink to &quot;Localização&quot;">​</a></h2><p><strong>Dashboard → CNAB → Processar Retorno</strong></p><hr><h2 id="passo-a-passo" tabindex="-1">Passo-a-Passo <a class="header-anchor" href="#passo-a-passo" aria-label="Permalink to &quot;Passo-a-Passo&quot;">​</a></h2><h3 id="etapa-1-acessar-importar-retorno" tabindex="-1"><strong>Etapa 1: Acessar Importar Retorno</strong> <a class="header-anchor" href="#etapa-1-acessar-importar-retorno" aria-label="Permalink to &quot;**Etapa 1: Acessar Importar Retorno**&quot;">​</a></h3><ol><li>Clique em <strong>&quot;CNAB&quot;</strong> no menu lateral</li><li>Clique em <strong>Processar Retorno&quot;</strong></li></ol><p><img src="'+r+'" alt="alt text" loading="lazy"></p><h3 id="etapa-2-selecionar-arquivo-de-retorno" tabindex="-1"><strong>Etapa 2: Selecionar Arquivo de Retorno</strong> <a class="header-anchor" href="#etapa-2-selecionar-arquivo-de-retorno" aria-label="Permalink to &quot;**Etapa 2: Selecionar Arquivo de Retorno**&quot;">​</a></h3><ol><li>Clique em <strong>&quot;Escolher Arquivo&quot;</strong> ou <strong>&quot;Procurar&quot;</strong></li><li>Localize o arquivo de retorno do banco</li><li>Selecione o arquivo (extensão .ret ou .txt)</li></ol><p><strong>Formato esperado:</strong></p><ul><li>Arquivo CNAB 240 retorno do Sicoob</li><li>Contém informações de processamento dos boletos</li></ul><blockquote><p><img src="'+t+`" alt="alt text" loading="lazy"></p></blockquote><hr><h3 id="etapa-3-verificar-dados-do-retorno" tabindex="-1"><strong>Etapa 3: Verificar Dados do Retorno</strong> <a class="header-anchor" href="#etapa-3-verificar-dados-do-retorno" aria-label="Permalink to &quot;**Etapa 3: Verificar Dados do Retorno**&quot;">​</a></h3><p>Sistema exibe informações sobre o arquivo:</p><table tabindex="0"><thead><tr><th>Informação</th><th>Descrição</th></tr></thead><tbody><tr><td><strong>Data do Retorno</strong></td><td>Quando banco gerou o arquivo</td></tr><tr><td><strong>Boletos no Retorno</strong></td><td>Quantos boletos estão no arquivo</td></tr><tr><td><strong>Erros Detectados</strong></td><td>Se houver problemas</td></tr></tbody></table><blockquote><p><strong>[FOTO: Informações sobre o arquivo de retorno]</strong></p></blockquote><h3 id="etapa-4-processar-retorno" tabindex="-1"><strong>Etapa 4: Processar Retorno</strong> <a class="header-anchor" href="#etapa-4-processar-retorno" aria-label="Permalink to &quot;**Etapa 4: Processar Retorno**&quot;">​</a></h3><ol><li>Clique em <strong>&quot;Processar Retorno&quot;</strong> ou <strong>&quot;Importar&quot;</strong></li><li>Sistema analisará cada boleto do retorno</li><li>Atualizará status conforme processamento</li></ol><p><strong>O que o sistema faz:</strong></p><ul><li>✅ Vincula retorno com remessa original</li><li>✅ Atualiza status de cada boleto</li><li>✅ Registra data de pagamento</li><li>✅ Gera log de processamento</li></ul><blockquote><p><strong>[FOTO: Processamento em andamento - barra de progresso]</strong></p></blockquote><h3 id="etapa-5-revisar-resultado" tabindex="-1"><strong>Etapa 5: Revisar Resultado</strong> <a class="header-anchor" href="#etapa-5-revisar-resultado" aria-label="Permalink to &quot;**Etapa 5: Revisar Resultado**&quot;">​</a></h3><p>Após processar, sistema mostra:</p><p>Resultado da Importação ├─ Total Processado: X boletos ├─ Pagos: X (✅ Status &quot;aceito&quot;) ├─ Rejeitados: X (❌ Verificar motivo) └─ Erros: X (⚠️ Corrigir e reprocessar)</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span></span></span>
<span class="line"><span>### **Etapa 6: Validar e Salvar**</span></span>
<span class="line"><span></span></span>
<span class="line"><span>1. Revise os resultados</span></span>
<span class="line"><span>2. Clique em **&quot;Confirmar&quot;** para finalizar</span></span>
<span class="line"><span>3. Mensagem de sucesso aparecerá</span></span>
<span class="line"><span></span></span>
<span class="line"><span>&gt; ![alt text](image-7.png)</span></span>
<span class="line"><span></span></span>
<span class="line"><span>## O Que Acontece Após Importar?</span></span>
<span class="line"><span></span></span>
<span class="line"><span>1. **Boletos atualizados** - Status muda conforme retorno</span></span>
<span class="line"><span>2. **Datas de pagamento registradas** - Quando banco processou</span></span>
<span class="line"><span>3. **Movimentação registrada** - Para rastreamento</span></span>
<span class="line"><span>4. **Relatórios atualizados** - Refletem novos status</span></span>
<span class="line"><span></span></span>
<span class="line"><span>## Status Que Podem Resultar</span></span>
<span class="line"><span></span></span>
<span class="line"><span>| Status | Significado | Ação |</span></span>
<span class="line"><span>|--------|------------|------|</span></span>
<span class="line"><span>| **Pago** | Boleto foi processado com sucesso | Nenhuma |</span></span>
<span class="line"><span>| **Rejeitado** | Banco recusou boleto | Verificar motivo e refazer |</span></span>
<span class="line"><span>| **Processando** | Ainda sendo processado | Aguardar próximo retorno |</span></span>
<span class="line"><span>| **Erro** | Problema na vinculação | Corrigir e reenviar |</span></span>
<span class="line"><span></span></span>
<span class="line"><span>## Possíveis Motivos de Rejeição</span></span>
<span class="line"><span></span></span>
<span class="line"><span>| Código | Motivo | Solução |</span></span>
<span class="line"><span>|--------|--------|---------|</span></span>
<span class="line"><span>| **01** | CPF inválido | Verifique CPF do cliente |</span></span>
<span class="line"><span>| **02** | Boleto duplicado | Não envie mesmo boleto 2x |</span></span>
<span class="line"><span>| **03** | Dados inconsistentes | Atualize dados do cliente |</span></span>
<span class="line"><span>| **08** | Código de rejeição do banco | Contate seu banco |</span></span>
<span class="line"><span></span></span>
<span class="line"><span>## Dicas Práticas</span></span>
<span class="line"><span></span></span>
<span class="line"><span>**Dica 1: Frequência de Retornos**</span></span>
<span class="line"><span>- Bancos geram retorno diário</span></span>
<span class="line"><span>- Importe retornos regularmente</span></span>
<span class="line"><span>- Facilita rastreamento de pagamentos</span></span>
<span class="line"><span></span></span>
<span class="line"><span>**Dica 2: Manter Arquivos**</span></span>
<span class="line"><span>- Guarde todos os arquivos de retorno</span></span>
<span class="line"><span>- Importante para auditoria</span></span>
<span class="line"><span></span></span>
<span class="line"><span>**Dica 3: Resolver Rejeições Rapidamente**</span></span>
<span class="line"><span>- Revise boletos rejeitados imediatamente</span></span>
<span class="line"><span>- Reenvie após correção</span></span>
<span class="line"><span></span></span>
<span class="line"><span>## Próximos Passos</span></span>
<span class="line"><span></span></span>
<span class="line"><span>Após importar retorno:</span></span>
<span class="line"><span></span></span>
<span class="line"><span>1. **Verificar boletos rejeitados** - Se houver</span></span>
<span class="line"><span>2. **Corrigir dados** - Se necessário</span></span>
<span class="line"><span>3. **Gerar nova remessa** - Caso haja rejeições</span></span>
<span class="line"><span>4. **Gerar relatório** - Para análise</span></span></code></pre></div>`,31)])])}const b=s(p,[["render",i]]);export{h as __pageData,b as default};
